import React from "react";
import { Navbar, Nav, Container, NavLink, NavDropdown } from "react-bootstrap";
import "./NavHeader.css"

class NavHeader extends React.Component {
    constructor(props) {
        super(props); 
        this.state = {
            user: this.props.user
        }  
    }

    componentDidUpdate(prevProps) {
        if (prevProps.user !== this.props.user) {
            this.setState({ user: this.props.user });
        }
    }

    render() {
        
        return (
            <header>
                <Navbar expand = "lg" className="bg-light">
                    <Container className="align-items-center justify-content-center">
                        <Navbar.Brand href="">Мед Часть</Navbar.Brand>
                        <Navbar.Toggle aria-controls="navbar-nav"/>
                        <Navbar.Collapse className="justify-content-end" id = "navbar-nav">
                            <Nav id="nav-list" >
                                <NavLink className="me-lg-3" href="/booking/book">Записаться</NavLink>
                                <NavLink className="me-lg-3" href="/booking/relative">Записи</NavLink>
                                <NavLink className="me-lg-3" href="/booking/archived" user = {this.state.user}>Архив</NavLink>
                                <NavDropdown  title="Профиль" className="d-flex flex-column me-lg-3 text-center center-text" id ="nav-dropdown">
                                    <NavDropdown.Item href="/">Профиль</NavDropdown.Item>
                                    <NavDropdown.Item href="/">Изменить</NavDropdown.Item>
                                    { (this.state.user && this.state.user.role === "ADMIN") ? (<NavDropdown.Item href="/">Админ панель</NavDropdown.Item>) : null}
                                    <NavDropdown.Divider/>
                                    <NavDropdown.Item href="/">Выйти из аккаунта</NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </header>
        )
    }
}

export default NavHeader;
